export async function loadNamespace(locale: string, ns: string): Promise<Record<string, any>> {
  const localeLoaders = messageLoaders[locale]
  if (!localeLoaders?.[ns]) {
    if (process.env.NODE_ENV === 'development') {
      console.warn(`[i18n] Namespace "${ns}" not found for locale "${locale}"`)
    }
    return {}
  }
  return (await localeLoaders[ns]()).default
}

export function hasNamespace(locale: string, ns: string): boolean {
  return !!messageLoaders[locale]?.[ns]
}

export function getLocales(): string[] {
  return Object.keys(messageLoaders)
}

export function getNamespaces(locale: string): string[] {
  return Object.keys(messageLoaders[locale] ?? {})
}
